import React from 'react'; 
import SkillBar from './SkillBar';

const Skills = () => {
  const skills = [
    // hard skills
    { name: 'HTML', level: 90 },
    { name: 'CSS', level: 80 },
    { name: 'JavaScript', level: 70 },
    { name: 'React', level: 60 },
  
    // language skills      
    { name: 'Arabic', level: 70 },      
    { name: 'English', level: 50 },     
    { name: 'German', level: 30 },
  
    // soft skills     
    { name: 'Problem Solving', level: 85 },      
    { name: 'Teamwork', level: 90 },      
    { name: 'Communication', level: 75 },     
  ];

  return (
    <div className="skills-container">
      <h1>Skills</h1>
    
      <div className="hard-skills">
        <h2>Hard Skills</h2>
         {skills.filter(s => !s.name.includes(' '))
           .map(skill => (      
             <SkillBar      
               key={skill.name}
               name={skill.name}      
               level={skill.level}     
             />    
           ))}   
      </div>
    
      <div className="language-skills">
        <h2>Languages</h2>
        {skills.filter(s => s.name.includes(' '))     
          .map(skill => (    
            <SkillBar       
               key={skill.name}      
               name={skill.name}    
               level={skill.level}   
            />     
          ))}      
      </div>

      <div className="soft-skills">       
        <h2>Soft Skills</h2>     
        {skills.filter(s => s.name.includes(' '))      
          .map(skill => (    
            <SkillBar   
               key={skill.name}     
               name={skill.name}       
               level={skill.level}      
            />       
          ))}        
      </div> 
    </div>
  );
}

export default Skills;
